import React from "react";
import ReactDOM from 'react-dom';
import { AppContainer } from 'react-hot-loader';
import {
    UserCard,
    ProductCard,
    TaggedContentCard,
    FlippingCard,
    FlippingCardFront,
    FlippingCardBack,
    RecipeCard,
    NewsHeaderCard,
    CryptoCard,
    PaymentCard,
    DropdownCard
} from '../node_modules/react-ui-cards';

const render = Component => {
    ReactDOM.render(
    <AppContainer>
    <Component />
    </AppContainer>,
    document.getElementById('root')
);
}
export default props => {
    return (

        <h2>
        Links
        </h2>
)
};
